import { useDispatch, useSelector } from 'react-redux';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.scss';
import NavBar from './Components/NavBar/NavBar';







function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<NavBar />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
